    body {
      background-color: black;
      padding: 0; margin: 0;
    }

    #center {
      display: flex; align-items: center; justify-content: center;
      width: 100%; height: 100%;

      position: relative; color: black; cursor: pointer;
    }

      position: absolute; object-fit: contain;
      height: 100%; width: 100%;
      
    }
    .sog.playing .sog1 {opacity: 0}
    .sog2 {opacity: 0; z-index: 2}

  </style>
  <script>

    const sog = new Audio("assets/audio/thunklit.opus");
    const dry = new Audio("assets/audio/thunkdark.o  pus");

    sog.volume = dry.volume = 0.5;
    sog.loop = dry.loop = false;

    document.addEventListener("click", function (e) {
      const scarysog = e.target.closest(".sog");
      if (!scarysog) return;
      if (!scarysog.classList.contains("playing")) {
        document.title = "?"; dry.pause(); dry.currentTime = 0; sog.play();
        scarysog.classList.add("playing"); scarysog.querySelector(".sog2").style.opacity = 1;
      } else {
        document.title = " ï¸Ž"; sog.pause(); sog.currentTime = 0; dry.play();
        scarysog.classList.remove("playing"); scarysog.querySelector(".sog2").style.opacity = 0;
      }
    });

  </script>
